import React, { useEffect, useState } from 'react';
import axios from 'axios';

const TenantList = () => {
    const [tenants, setTenants] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3001/tenants')
            .then(response => {
                setTenants(response.data);
            })
            .catch(error => {
                console.error('There was an error fetching the tenants!', error);
            });
    }, []);

    return (
        <div>
            <h2>Liste des locataires</h2>
            <ul>
                {tenants.map((tenant) => (
                    <li key={tenant.id}>{tenant.name} - {tenant.apartment} - {tenant.rent}â‚¬</li>
                ))}
            </ul>
        </div>
    );
};

export default TenantList;
